import React from "react";

export default function Header(props) {
    return (
        <header className="inner-container">
            <div>Clicky Game</div>
            <div>You've guessed correctly.</div>
            <div>Current Score: 0</div>
            <div>Top Score: 0</div>
        </header>
    );
}
